import customtkinter as ctk
from PIL import Image
from screeninfo import get_monitors
import base64
from io import BytesIO

# my profile pic in base64 image format DONT BE SCARED not makware i swear
b64_image = b"""

"""


image_data = base64.b64decode(b64_image)
img = Image.open(BytesIO(image_data))


ctk.set_appearance_mode("dark")
ctk.set_default_color_theme("blue")

app = ctk.CTk()
app.title("TS profile pic")
app.resizable(False, False)
app.geometry("200x200")


screen = get_monitors()[0]
screen_width = screen.width
screen_height = screen.height
window_width = 200
window_height = 200


x_offset = screen_width - window_width - 500
y_offset = int((screen_height - window_height) / 2) - 250  # move up by 50px
app.geometry(f"{window_width}x{window_height}+{x_offset}+{y_offset}")


ctk_img = ctk.CTkImage(light_image=img, dark_image=img, size=(200, 200))


label = ctk.CTkLabel(app, image=ctk_img, text="")
label.pack()

app.mainloop()
